import React from 'react';

const ToDoList = (props) => {

    return (
    <>
    <div className="todo">
    <i class="fa fa-times" aria-hidden="true"></i>
    <li>{props.text}</li>
    </div>
    </>
    );    
}

export default ToDoList;
